import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
    const { dispatch } = useContext(AuthContext);

    const handleLogout = () => {
        // Perform logout action
        dispatch({ type: 'LOGOUT' });
    };
    return (
        <div className='bg-white sidebar p-2'>
            <div className='m-2'>
                <i className='bi bi-bootstrap-fill me-2 fs-4'></i>
                <span className='brand-name fs-4'>Travlog Admin</span>
            </div>
            <hr className='text-dark' />
            <div className='list-group list-group-flush'>
                <Link to="admin/home" className='list-group-item py-2'>
                    <i className='bi bi-house-door fs-5 me-3'></i>
                    Home
                </Link>
                <Link to="admin/tour" className='list-group-item py-2'>
                    <i className='bi bi-map fs-5 me-3'></i>
                    Tour
                </Link>
                <Link to="admin/user" className='list-group-item py-2'>
                    <i className='bi bi-person fs-5 me-3'></i>
                    User
                </Link>
                <Link to="admin/booking" className='list-group-item py-2'>
                    <i className='bi bi-file-earmark-text fs-5 me-3'></i>
                    Booking
                </Link>

                <div className="list-group list-group-flush">
                    <button onClick={handleLogout} className="list-group-item py-2 border-0 bg-transparent">
                        <i className='bi bi-box-arrow-left fs-5 me-3'></i>
                        Logout
                    </button>
                </div>
            </div>
        </div>
    );
}

export default Sidebar;
